def findMaxConsecutiveOnes(nums):
    globalMax = 0
    count = 0
    if (len(nums) == 0):
        return 0
    for n in nums:
        if n == 1:
            count = count +n
            if(count > globalMax):
                globalMax = count
        elif n==0:
            count = 0
    return globalMax

